import React from 'react';
import styles from './TableList.module.css'
import ButtonHeader from '../button/ButtonHeader'

const TableList = () => {
    return (
        <table className={styles.table_main}>
            <tr>
                <col>
                    <ButtonHeader name="" />
                </col>
            </tr>
        </table>
    );
};

export default TableList;
